import json
import random
import time

import requests
from bs4 import BeautifulSoup


def scrape_wiki_page(entry):
    url = entry['wiki_url']
    model_ids = entry['model_ids']

    response = requests.get(url)
    soup = BeautifulSoup(response.text, 'html.parser')

    data = {}

    # Extract Name
    name = soup.find('h1', id='firstHeading').find('span', class_='mw-page-title-main').get_text(strip=True)

    # Extract Profession
    # Locate the NPC info table
    info_table = soup.find('table', class_='infobox npc-infobox')

    profession = []

    if info_table:
        rows = info_table.find_all('tr')
        for row in rows:
            th = row.find('th')
            if th and (th.find('a', string="Profession") or th.find('a', string="Professions")):
                # Found the row, now extract the data
                td = row.find('td')
                if td:
                    # Extract profession name
                    links = td.find_all('a')
                    profession = [links[i].get_text(strip=True) for i in range(1, len(links), 2) if '/wiki/' in links[i]['href']]
                break

    profession = profession or None

    # Extract Attributes and Levels
    attributes_section = soup.find('span', id='Skills')
    attributes = []  # To store multiple attributes with their levels
    if attributes_section:
        attributes_paragraph = attributes_section.find_parent('h2').find_next('p')
        if attributes_paragraph:
            # Full text from the paragraph
            full_text = attributes_paragraph.decode_contents().strip()  # Get raw HTML content to preserve <a> tags
            # Split by commas to handle multiple attributes
            # Only process if the paragraph contains expected content (level + attribute)
            if ',' in full_text or any(char.isdigit() for char in full_text):
                for part in full_text.split(','):
                    part = part.strip()  # Clean up any extra whitespace
                    # Parse this part with BeautifulSoup to isolate the <a> tag
                    part_soup = BeautifulSoup(part, 'html.parser')
                    attribute_link = part_soup.find('a')  # Find the <a> tag for the attribute name
                    if attribute_link:
                        attribute_name = attribute_link.get_text(strip=True)  # Extract the attribute name from <a>
                        # Extract everything before the attribute name as the level
                        try:
                            attribute_level = part_soup.get_text(strip=True).split(attribute_name)[0].strip()
                            attributes.append({'level': attribute_level, 'name': attribute_name})
                        except IndexError:
                            continue
        else:
            attributes = None
    else:
        attributes = None

    # Extract Skills Used
    skills_section = soup.find('span', id='Skills')
    skills_used = []  # Initialize an empty list for skills

    if skills_section:
        current = skills_section.find_parent(
            'h2').find_next_sibling()  # Start looking at the next sibling after the header
        while current and current.name != 'h2':  # Stop if the next header is reached
            if current.name == 'ul':  # Look for unordered lists
                for li in current.find_all('li'):  # Find all list items
                    # Extract the main skill name
                    skill_link = li.find_all('a')[1] if len(
                        li.find_all('a')) > 1 else None  # The second <a> contains the skill name
                    skill_name = skill_link.get_text(strip=True) if skill_link else None

                    # Add only the skill name to the list
                    if skill_name:
                        skills_used.append(skill_name)
            current = current.find_next_sibling()  # Move to the next sibling

    # Remove duplicates and clean up the skill list
    skills_used = list(set([skill.strip() for skill in skills_used if skill]))

    # Extract Armor Levels
    armor_levels = {}

    # Locate the correct table by searching for "Armor" in the header
    armor_table = None
    tables = soup.find_all('table')
    for table in tables:
        header = table.find('th')
        if header and "armor" in header.get_text(strip=True).lower():
            armor_table = table
            break

    if armor_table:
        rows = armor_table.find_all('tr')[1:]  # Skip the header row
        for row in rows:
            cells = row.find_all('td')
            for i in range(0, len(cells), 2):  # Damage type and level are in adjacent cells
                try:
                    img_tag = cells[i].find('img')  # Look for the image in the current cell
                    if img_tag:
                        damage_type = img_tag['alt']  # Extract the alt attribute for damage type
                        level = cells[i + 1].get_text(strip=True) if i + 1 < len(cells) else None
                        if damage_type and level:
                            armor_levels[damage_type] = level
                except (IndexError, AttributeError):
                    continue

    # Extract Items Dropped
    items_section = soup.find('span', id='Items_dropped')
    if items_section:
        items_list = items_section.find_parent('h2').find_next('ul')
        items_dropped = [item.get_text(strip=True) for item in items_list.find_all('a')] if items_list else []
    else:
        items_dropped = []

    # Prepare data for all model_ids
    for model_id in model_ids:
        # Validate each field and use a default fallback value
        data[model_id] = {
            'name': name if name else "Unknown",  # Default to "Unknown" if name is missing
            'profession': profession if profession else [],  # Default to an empty list if no professions
            'attribute_level': attributes if attributes else [],  # Default to an empty list if no attributes
            'skills_used': skills_used if skills_used else [],  # Default to an empty list if no skills
            'armor_levels': armor_levels if armor_levels else {},  # Default to an empty dictionary if no armor levels
            'items_dropped': items_dropped if items_dropped else []  # Default to an empty list if no items dropped
        }

    return data


def scrape_multiple_entries(entries):
    # Open the file initially and write the dictionary header
    with open('model_data.py', 'w') as f:
        f.write("results = {\n")

    for entry in entries:
        # Skip entries with no wiki_url
        if not entry.get('wiki_url'):
            print(f"Skipping entry with no URL: {entry}")
            continue

        print(f"Scraping: {entry['wiki_url']}")
        try:
            # Scrape the page
            data = scrape_wiki_page(entry)

            # Write each entry to the file immediately
            with open('model_data.py', 'a') as f:
                for model_id, model_data in data.items():
                    f.write(f"    {repr(model_id)}: {repr(model_data)},\n")

            print(f"Successfully scraped: {entry['wiki_url']}")

        except Exception as e:
            print(f"Error scraping {entry['wiki_url']}: {e}")

        # Throttle requests with a random delay
        delay = random.uniform(0.75, 2)
        print(f"Waiting for {delay:.2f} seconds before the next request...")
        time.sleep(delay)

    # Close the dictionary in the file
    with open('model_data.py', 'a') as f:
        f.write("}\n")

    print("Scraping completed.")




